export default function Home() {
  return (
    <div style={{ textAlign: "center", marginTop: "40px" }}>
      <h1>Aplicaciones</h1>

      <div style={{ 
        display: "flex", 
        flexDirection: "column", 
        gap: "15px", 
        marginTop: "30px" 
      }}>
        <button onClick={() => window.location.href = "/app1"}>App 1</button>
        <button onClick={() => window.location.href = "/app2"}>App 2</button>
        <button onClick={() => window.location.href = "/app3"}>App 3</button>
        <button onClick={() => window.location.href = "/app4"}>App 4</button>
      </div>
    </div>
  );
}
